import React from "react";
import Navbar from "./components/Navbar";
import Sidebar from "./components/Sidebar";
import HomePage from "./components/HomePage";

const App = () => {
  return (
    <>
      <div class="container-fluid p-0">
        <Navbar />
        <div class="row">
          <div
            class="col-4"
            style={{
              border: "1px solid gray",
              borderRadius: "5px",
              backgroundColor: "orange",
              height: "81vh",
              padding: "10px",
              borderRadius: "5px",
            }}
          >
            <Sidebar />
          </div>
          <div class="col-6">
            <HomePage />
          </div>
          <div
            class="col-2"
            style={{
              border: "1px solid gray",
              borderRadius: "5px",
              backgroundColor: "orange",
              height: "81vh",
              padding: "10px",
              borderRadius: "5px",
            }}
          ></div>
        </div>
      </div>
    </>
  );
};

export default App;
